" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Positive serum troponin T predicts lower survival after myocardial infarction",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 442px; height: 313px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
